import React from 'react';
import './login.css'


const login =(props)=>{
    return (
        <div className='container'>
            <span>Name :</span><input></input>
            <br></br>
            <span>Password :</span><input></input>
            <br></br>
            <button>Submit</button>
        </div>
    );
}

export default login;
